selector_to_html = {"a[href=\"#infinite-delay-disable-same-code-scanning\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Endlose Verz\u00f6gerung (denselben Code-Scan deaktivieren)<a class=\"headerlink\" href=\"#infinite-delay-disable-same-code-scanning\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#delay-7s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Verz\u00f6gerung 7 s<a class=\"headerlink\" href=\"#delay-7s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050209.png\"><img alt=\"../../media/2050209.png\" src=\"../../media/2050209.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Automatischer Sensormodus</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Gleiche Code-Verz\u00f6gerung Einstellungen<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>Um zu verhindern, dass der gleiche Barcode mehrfach im <a class=\"reference internal\" href=\"#continuous-mode\">kontinuierlichen Modus</a> und <a class=\"reference internal\" href=\"#auto-sensing-mode\">Automatischer Erkennungsmodus</a>, Sie k\u00f6nnen verlangen, dass der Scanner auf eine eingestellte Verz\u00f6gerung wartet, bevor der gleiche Barcode gescannt werden kann.</p>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C90.png\"><img alt=\"../../media/3030C90.png\" src=\"../../media/3030C90.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Keine Verz\u00f6gerung</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C91.png\"><img alt=\"../../media/3030C91.png\" src=\"../../media/3030C91.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Verz\u00f6gerung 1 s</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050200.png\"><img alt=\"../../media/2050200.png\" src=\"../../media/2050200.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Schl\u00fcssel-Trigger-Modus</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#delay-5s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">5s Verz\u00f6gerung<a class=\"headerlink\" href=\"#delay-5s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C95.png\"><img alt=\"../../media/3030C95.png\" src=\"../../media/3030C95.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">5s Verz\u00f6gerung</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Automatischer Sensormodus<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Im Automatik-Sensing-Modus erkennt der Scanner die Helligkeit der umgebenden Umgebung. Wenn sich die Helligkeit \u00e4ndert, wird der Scan ausgel\u00f6st. Der Scan endet wenn der Scan erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcbersteigt. Unabh\u00e4ngig davon, ob der letzte Scan erfolgreich war oder fehlgeschlagen ist, wird die Helligkeit der umgebenden Umgebung erneut erkannt.</p>", "a[href=\"#delay-3s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Verz\u00f6gerung 3s<a class=\"headerlink\" href=\"#delay-3s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan-Modus<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"#delay-1s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Verz\u00f6gerung 1 s<a class=\"headerlink\" href=\"#delay-1s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#no-delay\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Keine Verz\u00f6gerung<a class=\"headerlink\" href=\"#no-delay\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C93.png\"><img alt=\"../../media/3030C93.png\" src=\"../../media/3030C93.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Verz\u00f6gerung 3s</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kontinuierlicher Modus<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Wenn der Scanner erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcberschreitet, endet der aktuelle Scanner. Wenn die Zeit die angegebene Zeit \u00fcberschreitet, wird der n\u00e4chste Scan automatisch ausgel\u00f6st.</p>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C99.png\"><img alt=\"../../media/3030C99.png\" src=\"../../media/3030C99.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Endlose Verz\u00f6gerung (denselben Code-Scan deaktivieren)</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050204.png\"><img alt=\"../../media/2050204.png\" src=\"../../media/2050204.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Kontinuierlicher Modus</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C97.png\"><img alt=\"../../media/3030C97.png\" src=\"../../media/3030C97.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Verz\u00f6gerung 7 s</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
